// Agregar la Navegacion que se desea en la pagina
export default function Navegacion(){
    const nav = [
    {
        "id":{
            "id":"Informatica",
            "href":"/Informatica"
        },
        "sub": {
            "temas": [
                {
                    "id":"Cuartro",
                    "href":"/cuartro"
                },
                {
                    "id":"dos",
                    "href":"/dos"
                },
                {
                    "id":"Tres",
                    "href":"/tres"
                }
            ]
        }
    },
    {
        "id":{
            "id":"Concepto",
            "href":"/concepto"
        },
        "sub": {
            "temas": [
                {
                    "id":"Cuartro",
                    "href":"/cuartro"
                },
                {
                    "id":"dos",
                    "href":"/dos"
                },
                {
                    "id":"Tres",
                    "href":"/tres"
                }
            ]
        }
    }
    ]
    return nav;
}
